import React, { useState, useEffect } from 'react';
import axios from 'axios';

const CurrencyRate = () => {

  const [currencyData, setCurrencyData] = useState({});



  
  useEffect(() => {
    axios.get('http://hasanadiguzel.com.tr/api/kurgetir')
      .then((response) => {
        setCurrencyData(response.data.data);
      })
      .catch((error) => {
        console.error('Error fetching data: ', error);
      });
  }, []);

  const tr=Object.keys(currencyData).map((currencyCode) => (
    <tr key={currencyCode}>
    <td>{currencyData[currencyCode].CurrencyName}</td>
    <td>{currencyData[currencyCode].ForexBuying}</td>
    <td>{currencyData[currencyCode].ForexSelling}</td>
   </tr>
    ))
  return (
    <div style={{display:'flex',alignItems:'center' ,justifyContent:'center' ,marginTop:'25px'}}>
      <table dir='rtl' style={{position: 'relative',transform: 'translate(0,0)',left:'0'}}>
        <thead>
          <tr>
            <th>رمز العملة </th>
            <th>شراء </th>
            <th>مبيع  </th>
          </tr>
        </thead>
        <tbody>
            {tr}
      </tbody>
      </table>
    </div>
  )
}

export default CurrencyRate
